5="Fortsett",t5="Avbryt",i5="Forrige",n5="Fullført",s5="Valgfritt",a5="Ja",o5="Nei",l5="Start klassifisering",r5="Klassifiseringsguide",c5="Kunnskapsjekk",u5="Velkommen til Isotron",d5="Din guide til sikker informasjonshåndtering",_5="Usikker på hvordan du skal håndtere sensitiv informasjon? Vår klassifiseringsguide hjelper deg å ta de riktige beslutningene gjennom en enkel og effektiv sjekkliste.",f5="Isotron er designet for å hjelpe ansatte med å klassifisere sensitive data i henhold til ISO 27001-standarder. Ved å følge et beslutningstre kan brukere svare på en rekke spørsmål som fører til en klassifiseringsrapport, som sikrer overholdelse og riktig informasjonshåndtering.",m5="Kom i gang",p5="Opplæringsmoduler",h5="Start din læringsprosess med våre interaktive opplæringsmoduler og test kunnskapen din gjennom våre skreddersydde quizer.",g5="Opplæringsmodulene er designet for å gi omfattende kunnskap om ISO 27001-samsvar, og hjelpe ansatte å forstå viktigheten av datasikkerhet og de nødvendige trinnene for å opprettholde den. Hver modul inkluderer quizer for å forsterke læring og sikre at viktige konsepter huskes.",y5="Start modul",b5="Velkommen til Klassifiseringsguiden",k5="Denne guiden vil hjelpe deg med å bestemme passende klassifiseringsnivå for ditt dokument basert på ISO27001-standarder. Gjennom en serie spørsmål vil vi vurdere sensitiviteten og sikkerhetskravene for din informasjon.",x5="Hva du kan forvente",v5="Hva du kan forvente",z5="Velg alle typer sensitiv informasjon i dokumentet ditt",j5="Svar på spørsmål om dokumentets innhold og bruk",w5="Motta et klassifiseringsnivå basert på ISO27001",q5="Få spesifikke håndterings- og sikkerhetsinstruksjoner",S5="Estimert tid: 2-3 minutter",$5="Avanserte alternativer (Valgfritt)",N5="Å gi dokumentdetaljer vil hjelpe med å generere en mer personlig klassifiseringsrapport med spesifikke håndteringsinstruksjoner.",C5="Dokumentnavn",E5="f.eks. Finansrapport for 4. kvartal",R5="Filtype",O5="f.eks. PDF, DOCX, XLSX",A5